var debug_searchmaxitems = 50
searchurl = 'http://www.sfatulmedicului.ro/index.php?module=CliniciPrezentare&action=search_clinici&judet_id=0&specializare=&name=&localitate_zona='
searchindex = 150
searchindexmax = 193
maillist = []
setURLParameter = function(param) {
	//var iparam					= {paramName, paramValue, url}
	//if paramValue == null -> remove from query
	var iparam					= {name:'', value:'', url:window.location.href}
	jQuery.extend(true,iparam,param)
	if (iparam.url.indexOf(iparam.name + "=") >= 0){
		var prefix = iparam.url.substring(0, iparam.url.indexOf(iparam.name));
		var suffix = iparam.url.substring(iparam.url.indexOf(iparam.name));
		suffix = suffix.substring(suffix.indexOf("=") + 1);
		suffix = (suffix.indexOf("&") >= 0) ? suffix.substring(suffix.indexOf("&")) : "";
		if (iparam.value == null){
			iparam.url = prefix.substring(0,prefix.length - 1) + suffix;				
		}else{
			iparam.url = prefix + iparam.name + "=" + encodeURIComponent(iparam.value) + suffix;				
		}
	}else{
		if (iparam.value != null){
			if (iparam.url.indexOf("?") < 0)
				iparam.url += "?" + iparam.name + "=" + encodeURIComponent(iparam.value);
			else
				iparam.url += "&" + iparam.name + "=" + encodeURIComponent(iparam.value);
		}
	}
	return iparam.url
}
detaliicount = 0
searchnextpage = function(){
	return new Promise((resolve,reject)=>{
		searchindex++;
		searchurlnext = setURLParameter({name:'page',value:searchindex,url:searchurl})
		//console.log(searchurlnext)
		searchwindow = window.open(searchurlnext)
		searchwindow.addEventListener('DOMContentLoaded', (event)=>{
			detaliicount = 0
			searchwindow.document.querySelectorAll('div.container-clinici>div>a').forEach((ae,i)=>{
				//console.log(ae)
				if (i < debug_searchmaxitems){
					detaliicount++
					detaliiparse(ae.href).then((detalii)=>{
						console.log(detalii)
						if (typeof(detalii.success) != 'undefined' && detalii.success == true){
							if (!maillist.includes(detalii.mail)){
								maillist[maillist.length] = detalii.mail
							}
						}
						detaliicount--
						if (detaliicount == 0) {
							searchwindow.close()
							resolve()
						}
					})
				}
			})
		})
	})
}
detaliiparse = function(url){
	return new Promise((resolve,reject)=>{
		try{
			var ret = {success:false}
			var detaliiwindow = window.open(url)
			detaliiwindow.addEventListener('DOMContentLoaded', (event)=>{
				try{
					var detaliimaila = detaliiwindow.document.querySelector('a[href*=mailto]')
					//console.log(detaliimaila)
					if (detaliimaila == null) {detaliiwindow.close();resolve(ret)}
					ret.mail = detaliimaila.href.replace('mailto:','')
					//console.log(detaliimaila.href)
					ret.success = true
					detaliiwindow.close();
					resolve(ret)
				}catch (e) {
					console.log('e2',e)
					detaliiwindow.close();resolve(ret)
				}
			})
		}catch (e) {
			console.log('e1',e)
			detaliiwindow.close();resolve(ret)
		}
	})
}
mainloop = ()=>{
	console.log('mainloopstart',searchindex)
	if (searchindex >= searchindexmax) return
	searchnextpage().then(()=>{
		if (searchindex < searchindexmax) mainloop()
	})
}
